import React from 'react';
import './Profile.css';

const Profile = () => {
  return (
    <div className="profile-container">
      <div className="panel-purple"></div>
      <div className="panel-white-left"></div>
      <div className="panel-white-right"></div>
    </div>
  );
};

export default Profile;
